import React from 'react';

class ReviewAudiences extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      reviews: [],
    };
  }

  handleReviewSubmit = (review) => {
    const { reviews } = this.state;
    const newReview = {
      address: "Sample Address",
      type: "Sample Type",
      review: review,
      name: "Sample Name",
      status: "Sample Status",
    };
    const updatedReviews = [...reviews, newReview];
    this.setState({ reviews: updatedReviews });
  };

  render() {
    const { reviews } = this.state;

    return (
      <div className="container mt-5" id="reviews">
        <h2 className="mb-4">Reviews</h2>

        <div className="card-deck">
          <div className="card">
            <img src="https://i2.au.reastatic.net/300x200-format=webp/834c6299504b1fa49683d16ec8aad29a115b2c914e5e4f2922e6ec46d0981075/image.jpg" className="card-img-top" alt="House" />
            <div className="card-body">
              <h5 className="card-title">1105/442 Elizabeth Street, Melbourne, Vic 3000</h5>
              <p className="card-text">Type: Apartment</p>
              <form onSubmit={(e) => {
                e.preventDefault();
                this.handleReviewSubmit(e.target.review.value);
                e.target.reset();
              }}>
                <div className="form-group">
                  <label htmlFor="review">Review:</label>
                  <textarea className="form-control" id="review" rows="3" required></textarea>
                </div>
                <div className="form-group">
                  <label htmlFor="name">Name:</label>
                  <input type="text" className="form-control" id="name" required />
                </div>
                <div className="form-group">
                  <label htmlFor="status">Status:</label>
                  <select className="form-control" id="status" required>
                    <option value="">Select</option>
                    <option value="former">Former Resident</option>
                    <option value="current">Current Resident</option>
                  </select>
                </div>
                <button type="submit" className="btn btn-primary">Submit Review</button>
              </form>
            </div>
          </div>

          <div className="card">
            <img src="https://i2.au.reastatic.net/300x200-format=webp/41f681b4e16b15fab09fe9feca04ea93b0f275a9168f1e1157980f4ffa83da95/image.jpg" className="card-img-top" alt="House" />
            <div className="card-body">
              <h5 className="card-title">163 Albert Street, Port Melbourne, Vic 3207</h5>
              <p className="card-text">Type: Sharehouse</p>
              <form onSubmit={(e) => {
                e.preventDefault();
                this.handleReviewSubmit(e.target.review.value);
                e.target.reset();
              }}>
                <div className="form-group">
                  <label htmlFor="review">Review:</label>
                  <textarea className="form-control" id="review" rows="3" required></textarea>
                </div>
                <div className="form-group">
                  <label htmlFor="name">Name:</label>
                  <input type="text" className="form-control" id="name" required />
                </div>
                <div className="form-group">
                  <label htmlFor="status">Status:</label>
                  <select className="form-control" id="status" required>
                    <option value="">Select</option>
                    <option value="former">Former Resident</option>
                    <option value="current">Current Resident</option>
                  </select>
                </div>
                <button type="submit" className="btn btn-primary">Submit Review</button>
              </form>
            </div>
          </div>

          <div className="card">
            <img src="https://i2.au.reastatic.net/200x300-resize,extend,r=33,g=40,b=46/e8e44ba7cbc7eec3f3e7681842b9dd6d3dc5375dbe1d072e172687996831b898/image.jpg" className="card-img-top" alt="House" />
            <div className="card-body">
              <h5 className="card-title">108/593 Elizabeth Street, Melbourne, Vic 3000</h5>
              <p className="card-text">Type: Student Accommodation</p>
              <form onSubmit={(e) => {
                e.preventDefault();
                this.handleReviewSubmit(e.target.review.value);
                e.target.reset();
              }}>
                <div className="form-group">
                  <label htmlFor="review">Review:</label>
                  <textarea className="form-control" id="review" rows="3" required></textarea>
                </div>
                <div className="form-group">
                  <label htmlFor="name">Name:</label>
                  <input type="text" className="form-control" id="name" required />
                </div>
                <div className="form-group">
                  <label htmlFor="status">Status:</label>
                  <select className="form-control" id="status" required>
                    <option value="">Select</option>
                    <option value="former">Former Resident</option>
                    <option value="current">Current Resident</option>
                  </select>
                </div>
                <button type="submit" className="btn btn-primary">Submit Review</button>
              </form>
            </div>
          </div>
        </div>

        {reviews.length > 0 && (
          <div className="mt-5">
            <h3>Reviews:</h3>
            {reviews.map((review, index) => (
              <div key={index} className="card mt-3">
                <div className="card-body">
                  <h5 className="card-title">{review.address}</h5>
                  <p className="card-text">Type: {review.type}</p>
                  <p className="card-text">Review: {review.review}</p>
                  <p className="card-text">Name: {review.name}</p>
                  <p className="card-text">Status: {review.status}</p>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    );
  }
}

export default ReviewAudiences;
